import { height } from '@material-ui/system';
import React from 'react';
import TestimoData from './Components/TestimoData';
/*import img1 from './Images/img1.png';
import img2 from './Images/img2.png';
import img3 from './Images/img3.png';*/
import img1 from '../src/Images/img1.png';
import img2 from '../src/Images/img2.png';
import img3 from '../src/Images/img3.png';
const TestimoSection = ()=>{
    return(
        <>
        <br/>
        <br/>
        <br/>
        <div className='container'>
        <h4 className='text-center'>See What Client's Says</h4>
        <h1 className='text-center mb-5'>TESTIMONIAL</h1>
        <div className='row'>
          <div className='col-md-8 col-center m-auto'>
            <div className='carousel slide' data-ride='carousel'>
              <div className='carousel-inner'>
                <div className='carousel-item active'>
                <div className='img-box'>
                  <img src={img1} alt='img1...'/>
                  <p className='testimonial'>loremcksdnhjhfgfvbvhjfbvhjshvgshvgsh</p>
                  <p className='overview'><b>Jenn Save</b> , office head</p>
                  </div>
                </div>
                <div className='carousel-item active'>
                <div className='img-box'>
                  <img src={img2} alt='img1...'/>
                  <p className='testimonial'>loremcksdnhjhfgfvbvhjfbvhjshvgshvgsh</p>
                  <p className='overview'><b>Jenn Save</b> , office head</p>
                  </div>
                </div>
                <div className='carousel-item active'>
                <div className='img-box'>
                  <img src={img3} alt='img1...'/>
                  <p className='testimonial'>loremcksdnhjhfgfvbvhjfbvhjshvgshvgsh</p>
                  <p className='overview'><b>Jenn Save</b> , office head</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>

            </div>

        </>
    );
};
export default TestimoSection;
